function minOperations(nums: number[], k: number): number {
    // Step 1: Reverse the array to simulate removal from the end
    nums.reverse();

    // Step 2: Use a set to track collected elements
    const collected = new Set<number>();

    // Step 3: Iterate over the array to collect elements 1 through k
    for (let i = 0; i < nums.length; i++) {
        collected.add(nums[i]);

        // Once we have collected all elements from 1 to k, return the operations count
        if (collected.size === k) {
            // Since we want elements 1 through k, check if all are collected
            let allCollected = true;
            for (let j = 1; j <= k; j++) {
                if (!collected.has(j)) {
                    allCollected = false;
                    break;
                }
            }

            // If all elements are collected, return the index + 1 as the operation count
            if (allCollected) {
                return i + 1;
            }
        }
    }

    // In case something goes wrong, though the problem guarantees a solution
    return -1;
};
